// HasIssuer applies the HasEdge predicate on the "issuer" edge.
func HasIssuer() predicate.SelfSignedIssuer {
	return predicate.SelfSignedIssuer(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2O, true, IssuerTable, IssuerColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasIssuerWith applies the HasEdge predicate on the "issuer" edge with a given conditions (other predicates).
func HasIssuerWith(preds ...predicate.Issuer) predicate.SelfSignedIssuer {
	return predicate.SelfSignedIssuer(func(s *sql.Selector) {
		step := newIssuerStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.SelfSignedIssuer) predicate.SelfSignedIssuer {
	return predicate.SelfSignedIssuer(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.SelfSignedIssuer) predicate.SelfSignedIssuer {
	return predicate.SelfSignedIssuer(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.SelfSignedIssuer) predicate.SelfSignedIssuer {
	return predicate.SelfSignedIssuer(sql.NotPredicates(p))
}
